  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Bowdoin
  NWR outlines Refuge accomplishments during the 1964 calendar year. The report begins
  by summarizing the weather conditions, habitat conditions, water conditions, and
  food and cover conditions during the year. Wildlife- including migratory birds,
  upland game birds, big game animals, furbearers, predators, rodents, mammals, raptors,
  fish, reptiles, and diseases- is also covered. The Refuge development and maintenance
  section discusses physical developments, plantings, vegetation control, and prescribed
  burning. Resource management is outlined; topics include grazing and fur harvesting.
  A progress report on field investigations and applied research is also provided.
  The public relations section of the report describes recreational uses, Refuge visitors,
  Refuge participation, hunting, violations, and safety. Items of interest, N-R forms,
  photographs, and newspaper articles are attached.\",\n\t\"license_title\": \"License
